INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Mani Ratnam', '1956-06-02', 'Madurai, Tamil Nadu, India', 'nm0711745', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTA4NjIwNDY2OF5BMl5BanBnXkFtZTYwNzczMDkz._V1_.jpg', 'The man who revolutionized Tamil-language cinema, Mani Ratnam is the biggest director in south India and one of the most respected directors in all of India. Each of his films contain its own unique style, with beautifully photographed songs and unique back-lighting.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Gulzar', '1936-08-18', 'Dina, British India [now Pakistan]', 'nm0347899', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjQzMjEwMDIxMF5BMl5BanBnXkFtZTgwMDg1ODA0OTE@._V1_.jpg', 'Gulzar is a writer, a lyricist, a director and, at heart, a poet. His films, sensitive, lyrical, and yet successful, were a welcome relief from the violent films that filled the 1970s and 1980s.Born Sampooran Singh Kalra in Deena, in the Jhelum District in what is now Pakistan, he came to Delhi after the partition during independence as a poet.');
