INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Shraddha Kapoor', '1987-03-03', 'Mumbai, Maharashtra, India', 'nm3601766', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU1NzU2Nzk0MV5BMl5BanBnXkFtZTgwMzIzMzg4MjE@._V1_.jpg', 'Shraddha Kapoor is an Indian film actress. Prior to making her cinematic debut, she took up theatre studies at Boston University, but dropped out after her first year to begin her acting career. She made her screen debut in the 2010 drama fictional Teen Patti for which she earned a nomination for the Filmfare Best Female Debut.');
