INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Karan Johar', '1972-05-25', 'Bombay, Maharashtra, India', 'nm0424103', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTM5Njk5MDI0OV5BMl5BanBnXkFtZTcwOTA0ODE2OQ@@._V1_.jpg', 'A close friend of Shahrukh Khan, he assisted Yash Chopra\'s Yash Raj Films during the early days of of his career, making his directorial debut with the mega-hit "Kuch Kuch Hota Hai". He also had a popular chat show named "Koffee with Karan" The success of "KKHH" made him one of the most high-profile directors in the Hindi-language Mumbai Film industry, popularly known as Bollywood.');
